import React, { Component } from 'react';
import Project from './main_components/Project';

class Portfolio extends Component {
    render() {
        return <>
            <section className={'portfolio'} id='portfolio'>
                <div className='portfolio_container'>
                    <p className={'title'}>Projects</p>
                    <div className='portfolio_container_main_project'>
                        <p className={'portfolio_cont_project_title'} ></p>
                        <img className="portfolio_pic" src={hjj} alt="" />
                        <p className={'portfolio_cont_project_description'}></p>
                        <p className={'portfolio_cont_project_tags'}></p>
                        <div className={'portfolio_cont_project_buttons'}>
                            <div className={'portfolio_cont_project_button'}>
                                <a className={'portfolio_cont_project_link'} target="_blank" rel="noopener noreferrer" href={props.adressLive}>Show</a>
                            </div>
                            <div className={'portfolio_cont_project_button'}>
                                <a className={'portfolio_cont_project_link'} target="_blank" rel="noopener noreferrer" href={props.adressGithub}>Code</a>
                            </div>
                        </div>
                    </div>

                    <p className={'title'}>Other projects</p>
                    <div className={'portfolio_cont'}>

                        {this.props.portfolio.map(p =>
                            < Project
                                key={p.id}
                                title={p.title}
                                img={p.img}
                                desctiption={p.desctiption}
                                tags={p.tags}
                                adressLive={p.adressLive}
                                adressGithub={p.adressGithub} />
                        )}

                    </div>
                </div>
            </section>
        </>
    };
};

export default Portfolio;
